import styled from '@emotion/styled'
import Link from 'next/link'

function Navigation() {
    return(
        <NavigationStyled>
            <ul>
                <li>
                    <Link href = "/signup">
                        <a>SignUp</a>
                    </Link>
                </li>
            </ul>
        </NavigationStyled>
    )
}

const NavigationStyled = styled.div`
    ul{
        list-style: none;
        padding: 0;
        margin: 0;
        display: flex;

        li{
            margin-left: 10px;
        }

        a{
            text-decoration: none;
            color: #000000;

            &:hover{
                text-decoration: underline;
            }

            &.active{
                color: #EF6800;
            }
        }
    }
`

export default Navigation
